eight and high-quality materials, this stand promises durability and elegance, taking your display to new heights.<br />','<ul><li>1.3kg weight</li><li>The base of the stand measures 26cm by 26cm</li><li>Adjustable height, which ranges from 28cm to 40cm/</li></ul>','iron-man-helmet-stand-base','iron-man-helmet-stand-base','Iron Man helmet stand base, product','Iron Man helmet stand base','Iron Man helmet stand base','','','','');
